// SPDX-License-Identifier: MIT

pragma solidity ^0.8.6;

import "./ERC721WithRoyalty.sol";

contract RoyaltyFactory {
    address[] public allRoyalties;
    uint256 royaltyCounter;

    event LoyaltyERC721Created(
        string name,
        string symbol,
        address _royaltyReceiver, 
        uint256 _royaltyPercentage,
        uint256
    );

    constructor() {
        royaltyCounter = 0;
    }
    
    function createRoyaltyERC721(
        string memory name, 
        string memory symbol, 
        address _royaltyReceiver, 
        uint256 _royaltyPercentage
    ) external returns (address loyalty, uint256 counter) {
        ERC721WithRoyalty _loyalty = new ERC721WithRoyalty(name, symbol, _royaltyReceiver, _royaltyPercentage);
        loyalty = address(_loyalty);
        allRoyalties.push(loyalty);
        emit LoyaltyERC721Created(name, symbol, _royaltyReceiver, _royaltyPercentage, allRoyalties.length);

        royaltyCounter++;
        counter = royaltyCounter;
    }
}
